import './App.css'

const todos = [
  { task: 'mow the yard', id: uuid() },
  { task: 'Work on Odin Projects', id: uuid() },
  { task: 'feed the cat', id: uuid() },
]

function App() {
  return (
    <ul>
      {todos.map((todo) => (
        // here we are using the already generated id as the key.
        <li key={todo.id}>{todo.task}</li>
      ))}
    </ul>
  )
}

export default App
